               <p>Email : {props.name}</p>
               <p>Phone number : {props.name}</p>
               <p>Sex : {props.sex}</p>
    <div className="btn-container">
   {/* <button onClick={(e)=> props.updateClick(e)}className="proceed-btn"  id={props.id}>Go back</button> */} 
    <button onClick={(e)=> props.deleteClick(e)}className="proceed-btn" id={props.id}>Delete Data</button>
    </div>
    </div>
    </div>
          );
